import React from 'react';
import './index.css';
import Navbar from './Navbar';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../node_modules/bootstrap/dist/js/bootstrap.bundle';
import myimg from '../src/images/myimg.jpg';
import {NavLink} from 'react-router-dom';


const Common=(props)=>{
     return(
         <> 
         <div className="container-fluid mt-3">
         <div className="row">
             <div className="col-10 mx-auto">
             <div className="row">
               <div className="col-md-6 order-1 order-lg-1 mt-5 d-flex flex-column justify-content-center">
                 <h1>{props.home}<strong className="text-danger font-weight-bolder">My team</strong></h1>
                 <h2 className='my-3'>{props.homeslogan}</h2>
                 <div className='mt-3'>
                    <NavLink   to="/services" className="btn get-started" style={{backgroundColor:'teal',color:'white',borderRadius:39}}>Get Started</NavLink>

                 </div>

               </div>
               <div className="col-lg-6 order-2 order-lg-2 header-img mt-5 d-flex justify-content-center">
                  <img  src={props.myimg} alt="anand" className="img-fluid"/>
                    

               </div>

             </div>
            </div>
         </div>

      </div>
             
         </>
     )
}
export default Common;
